import "./MenuCss.css";

const menuList = [
  {
    id: 1,
    title: "Home",
  },
  {
    id: 2,
    title: "Home 2",
  },
  {
    id: 3,
    title: "Home 3",
  },
  {
    id: 4,
    title: "Home 4",
  },
];

const MenuExample = () => {
  return (
    <nav className="menu">
      <ul className="menu__list">
        {menuList.map((item) => (
          <li className="menu__i"></li>
        ))}
      </ul>
    </nav>
  );
};

export default MenuExample;
